    public List<Integer> findSubstring(String s, String[] words) {
        HashMap<String, Integer> wordMap = new HashMap<>();
        for (int i = 0; i < words.length; i++) {
            int n = wordMap.getOrDefault(words[i], 0) + 1;
            wordMap.put(words[i], n);
        }

        List<String> strList = new ArrayList<>();
        List<Integer> list = new ArrayList<>();
        int wordLen = words[0].length();
        int i = 0;
        while (i <= s.length() - wordLen) {
            String word = s.substring(i, i + wordLen);
            int count = wordMap.getOrDefault(word, 0);
            if (count > 0) {

                long count2 = strList.stream().filter(str -> str.equals(word)).count();
                if (count2 < count) {
                    i += wordLen;
                    strList.add(word);
                    if (strList.size() == words.length) {
                        i -=  words.length * wordLen;
                        list.add(i++);
                        strList.clear();
                    }
                } else {
                    i -=  strList.size() * wordLen - 1;
                    strList.clear();
                }
            } else {
                i -=  strList.size() * wordLen - 1;
                strList.clear();
            }
        }
        return list;
    }

